; Cxx - Set SR [Dxx in xm]                           *
; Kxx - > default EVOL && < 80h: set evol_max        *
; 6xx     (otherwise use default evol max, 64)       *
;       80h: Turn off EVOL sweep                     *
;       81h-0FFh: set evol_time (-80h)               *
; Lxx - 00-1Fh: set minimum noise frequency during   *
; 5xx           noise frequency sweep                *
;       20-3Fh: set maximum noise frequency during   *
;               noise frequency sweep (-20h)         *
;       40h-7Ch: set minimum band pass DSP_C0        *
;                [default 34h]                       *
;       80h-FFh: set minimum echo volume for filter  *
;                sweeps [default 20h]                *
; M00-3F - Set PWM time                              *
; M40-M47 Set min wave table (0-7)                   *
; M48-M4F Set max wave table (0-7)                   *
; M7F - Enable Direct Gain                           *
; M80-MFF - Enable ADSR, set AD                      *
; N00 - Disable filter sweep                         *
; N01 - Filter sweep to bandpass one shot            *
; N02 - Filter sweep to bandpass ping pong           *
; Nxx - Delay before changing filter                 *
; Q80 - MVOL slides to default, EVOL decreses        *
; Q81-FF - MVOL slides to Qxx-80, EVOL increases     *
; Rxx - Tremolo (uses vibrato waveform set by S3x)   *
; S01 - Turn on echo for channel                     *
; S02 - Turn off echo for channel                    *
; S03 - Turn on echo for all channels                *
; S04 - Turn off echo for all channels               *
; S05 - Turn on pitch modulation for one channel     *
; S06 - Turn off pitch modulation for one channel    *
; S07 - Turn on pitch modulation for all channels    *
; S08 - Turn off pitch modulation for all channels   *
; S09 - Turn on noise generation for one channel     *
; S0A - Turn off noise generation for one channel    *
; S0B - Turn on noise generation for one channel     *
; S0C - Turn off noise generation for all channels   *
; S0D - Disable echo write                           *
; S0E - Enable echo write                            *
; S0F - Reset EVOL, EFIR, EFB, disable filter sweep  *
; S30 - Set vibrato wavefrom: Sine [default]         *
; S31 - Set vibrato wavefrom: Ramp Down              *
; S32 - Set vibrato wavefrom: Square                 *
; S33 - Set vibrato wavefrom: Tri/Square             *
; S34 - Set vibrato waveform: Triangle               *
; S35 - Set vibrato wavefrom: Ramp Up                *
; S36 - Set vibrato wavefrom: Square 2               *
; S37 - Set vibrato wavefrom: Square 3               *
; S38 - Set vibrato + FM wavefrom: Sine              *
; S39 - Set vibrato + FM wavefrom: Ramp Down         *
; S3A - Set vibrato + FM wavefrom: Square            *
; S3B - Set vibrato + FM wavefrom: Tri/Square        *
; S3C - Set vibrato + FM waveform: Triangle          *
; S3D - Set vibrato + FM wavefrom: Ramp Up           *
; S3E - Set vibrato + FM wavefrom: Square 2          *
; S3F - Set vibrato + FM wavefrom: Square 3          *
; S44 - Set echo volume sweep max -> min             *
; S45 - Set echo volume sweep min -> max             *
; S46 - Dxx without vibrato                          *
; S47 - Dxx with vibrato                             *
; S48 - Disable PWM                                  *
; S49 - Enable PWM                                   *
; S4A - Set noise frequency sweep decrease           *
; S4B - Set noise frequency sweep increase           *
; S4C - Disable noise frequency sweep repeat         *
; S4D - Enable noise frequency sweep repeat          *
; S4E - Disable noise frequency sweep ping pong      *
; S4F - Enable noise frequency sweep ping pong       *
; S5x - Enable noise frequency sweep (+10h)          *
; S6x - Swing tempo; mod_speed+x, mod_speed          *
; S8x - Set noise frequency sweep speed              *
; S91 - Evol Inc->Evol Dec | Evol Dec->Evol Inc [FM] *
; S92 - Mute channel                                 *
